import React from 'react'
// import './Navbar.css';

const Navbar = ({name, setAuthentication}) => {
    const logout = (e) => {
        e.preventDefault();
        localStorage.removeItem("token")
        setAuthentication(false);
    }
    console.log("Passed")
    console.log(name)
    return (
        <div className="_navbar navbar navbar-expand-lg px-3 navbar-light bg-light">
            <h1 className="nav-name">{name}</h1>

            <button className="nav-btn" onClick={logout}> Logout </button>
        </div>
    )
}

export default Navbar
